description:
Vous travaillerez en collaboration avec des chargés de projets, sous la direction du Directeur Technique. Vos missions seront les suivantes :
Développer des modules spécifiques en C# s’intégrants dans nos solutions Winform, ASP.NET MVC et SharePoint existantes ;
Contribuer à l’évolution permanente de nos solutions, notamment le développement de solutions utilisant ASP MVC.NET, Entity Framework et HTML5 ;
Mettre en œuvre l’interopérabilité souhaitée par le client avec : le système comptable (NAVISION, SAGE etc.), la messagerie en place (Lotus Notes, MS Outlook), les serveurs ou CMS en place (SharePoint, Google Docs etc.) ;
Maintenir en condition opérationnelle les solutions utilisées par les clients ;
Si souhaité, possibilité d’effectuer des missions auprès de nos clients en France et à l’étranger.
Issu d’une formation (> Bac+3) en informatique, vous avez une première expérience (minimum 3 ans) en développement C#. Vous avez déjà programmé sous ASP.NET MVC et vous avez une bonne connaissance du JavaScript et du HTML Vous êtes intéressé par le travail en milieu interculturel et avez une bonne pratique de l’anglais.
Vous souhaitez rejoindre une structure à taille humaine en croissance où vos compétences seront reconnues et vous épanouir dans un poste polyvalent, merci d’envoyer votre CV à l’adresse suivante : recrutement@aidimpact.com
Rémunération selon niveau d’études
Date de début : Dès que possible
Localisation : Toulouse
